import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import UnPokemon from './Components/UnPokemon.js';

fetch('https://pokeapi.co/api/v2/pokemon/charizard/').then((response) => {
  console.log(response)
})

function App() {
  return (
    <div className="App">
      <UnPokemon />
    </div>
  );
}

export default App;
